Here's my cosplays and schedule for @galaxyconrichmond this weekend! Friday I'll be in Howl at my booth 2220 2-5 pm, and at the VIP party 8-10. Saturday I will be prejudging all day and in Esther for the cosplay contest in the evening, and Sunday I'll be in Makima at my booth most of the afternoon, 1-5 pm. I may be at my booth here and there outside of those hours, but if you want to say hi I will definitely be there those hours Friday and Sunday! See you there!

