Happy Diablo 4 early release! All my diablo cosplays in chronological order of being made; Tyrael 2014, Diablo 2016, the monk 2018, Maghda 2019, and the sorceress 2023. 

@playdiablo is my most cosplayed from anything, it was one of the first games I ever played (diablo 2) and was my gateway into cosplay - I made Tyrael as my first purpose built cosplay for a con and cosplay competition. Photo credits are phone via @plexicosplay or lost to time

